import React from 'react';

import './Home.scss';

function Home() {

    return (
        <div className="home">
            <LoadRoutes routes={routes}/>
        </div>
    )
}

function LoadRoutes({routes}) {
    return (
        <Switch>
            {routes.map((route,index) => (
                <Route 
                    key={index}
                    path={route.path}
                    exact={route.exact}
                    component={route.component}
                />
            ))}
        </Switch>
    )
}

export default Home;
